import React, { useState } from 'react'
import { Stocks } from "../Stocks";
import { Link, Route } from 'react-router-dom'
import { nikeAir } from "../data";
function Models({data}) {
    const [state, setState] = useState({
        post: {}
    })


    const fetchSingle = async (item) => {
        console.log(item)
        setState({
            post: nikeAir
        })
    }

    return (
        <div>
            {nikeAir.map((item, i) => {
                return (
                    <Link onClick={() => { fetchSingle(item) }}  key={i} to={`/Modles/${item.name}`} style={{ 'display': 'block' }}>{item.name}</Link>
                )
            })}
            <Route path='/blog/:id' render={() => <Stocks single={state.post} />} />
        </div>

    )
}

export default Models
